import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function SolicitudSociedades() {
  const [formData, setFormData] = useState({
    razonSocial: "",
    nombreComercial: "",
    nif: "",
    direccion: "",
    localidad: "",
    cp: "",
    telefono: "",
    movil: "",
    email: "",
    representanteLegal: "",
    cargo: "",
    fechaConstitucion: "",
    fechaInicioActividad: "",
    cnae: "",
    actividad: "",
    importe: "",
    plazo: "",
  });

  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const payload = {
        // Datos del formulario
        TITULAR: formData.razonSocial,
        NOMBRE: formData.razonSocial.split(" ")[0] || formData.razonSocial,
        APELLIDOS: formData.razonSocial.split(" ").slice(1).join(" ") || "",
        NOMBRE_COMERCIAL: formData.nombreComercial || formData.razonSocial,
        CIT: formData.nif,
        ACTIVIDAD: formData.actividad,
        COD_CNAE: formData.cnae,

        // Valores m√≠nimos requeridos
        COD_DELEGACION: "001",
        TIPO_IDENTIDAD: "J", // Jur√≠dica (Sociedad)

        // Fechas
        F_ALTA: new Date().toISOString().split("T")[0],
        F_CONSTITUCION: formData.fechaConstitucion || new Date().toISOString().split("T")[0],

        // Defaults cr√≠ticos
        COD_SOPORTE: 1,
        ID_OBSERVACION: 0,
        PAIS_NIF: "ES",
        COD_GESTOR: "WEB",
        VALIDEZ_DATOS: "S",
        PROCESO_ALTA: "WEB",
        EXPORTA: "N",
        NIVEL_COMPLETITUD: 0,
        CLASIF_PYME: "S",
        G3_BLOQUEO: "X",
        IDIOMA: "S",

        // Campos opcionales / que backend completa con DEFAULTS
        DATOS_REGISTRALES: " ",
        NUM_SS: " ",
        EXP_EXTERNO_WEB: " ",
        WEB: " ",
        WEB_IDENTIDAD: 0,
        WEB_USUARIO: 0,
        CLASIF_PYME_METODO: "A",
        DECLARAR_ASNEF: "N",
        PERSONA_RESPONSABILIDAD_PUBLICA: "N",
        PAIS_NACIONALIDAD: "ES",
      };

      console.log("üì§ Enviando payload (Sociedades):", payload);

      const res = await axios.post("http://127.0.0.1:5000/api/identidades", payload);

      if (res.status === 201 || res.status === 200) {
        setMessage("‚úÖ Solicitud creada con √©xito. REF_ID: " + res.data.REF_ID);
        setTimeout(() => {
          navigate("/alta");
        }, 1500);
      } else {
        setMessage("‚ö†Ô∏è Algo raro pas√≥. C√≥digo: " + res.status);
      }
    } catch (err) {
      console.error("‚ùå Error en solicitud:", err);
      setMessage(
        "‚ùå Error: " +
          (err.response?.status || "") +
          " - " +
          (err.response?.data?.error || err.message)
      );
    }
  };

  return (
    <div style={{ maxWidth: "800px", margin: "0 auto" }}>
      <h2>Solicitud de Aval Sociedades</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Raz√≥n Social:
          <input
            type="text"
            name="razonSocial"
            value={formData.razonSocial}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          Nombre Comercial:
          <input
            type="text"
            name="nombreComercial"
            value={formData.nombreComercial}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          NIF:
          <input
            type="text"
            name="nif"
            value={formData.nif}
            onChange={handleChange}
            required
          />
        </label>
        <br />

        <label>
          Fecha de Constituci√≥n:
          <input
            type="date"
            name="fechaConstitucion"
            value={formData.fechaConstitucion}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          CNAE:
          <input
            type="text"
            name="cnae"
            value={formData.cnae}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Actividad:
          <input
            type="text"
            name="actividad"
            value={formData.actividad}
            onChange={handleChange}
          />
        </label>
        <br />

        <button type="submit">Enviar Solicitud</button>
      </form>

      {message && <p>{message}</p>}
    </div>
  );
}

export default SolicitudSociedades;
